    private void jButton2ActionPerformed(java.awt.event.ActionEvent evt) {//GEN-FIRST:event_jButton2ActionPerformed
        // TODO add your handling code here:
        Filee f1 = new Filee();
        if(f1.ConfirmFood()){
            for (int i = 0; i < 10; i++) {
                try{
                if(str[i].length() > 2){
                    f1.AddFood(str[i]);
                }}catch(Exception e){ }
            }
            f1.Success("addition Successful !!!");
            or1.setText("");
            or2.setText("");
            or3.setText("");
            or4.setText("");
            or5.setText("");
            or6.setText("");
            or7.setText("");
            or8.setText("");
            or9.setText("");
            or10.setText("");
            qntiti.setText("1");
            Total.setText("00.00");
        }
    }//GEN-LAST:event_jButton2ActionPerformed

